# Default values for ai-scheduler.
# This is a YAML-formatted file.
# Declare variables to be passed into your templates.
replicaCount: 3
image:
  repository: registry.aibee.cn/platform/kubernetes/ai-scheduler
  pullPolicy: IfNotPresent
restartPolicy: Always

resources:
  limits:
    cpu: 8
    memory: 8Gi
  requests:
    cpu: 8
    memory: 8Gi

securePort: 20888
healthzPort: 20999

disablePreemption: true

leaderElect: true
leaseDuration: "15s"
renewDeadline: "10s"
retryPeriod: "2s"

algorithmSource:
  provider: "DefaultProvider"
clientConnection:
  burst: 2000
  qps: 1000

cluster: "bj"

bjConfig:
  apiVersion: v1
  clusters:
    - cluster:
        certificate-authority-data: 
        server: https://172.16.16.250:8443
      name: kubernetes
  contexts:
    - context:
        cluster: kubernetes
        user: admin
      name: kubernetes
  current-context: kubernetes
  kind: Config
  preferences: {}
  users:
    - name: admin
      user:
        client-certificate-data: 
        client-key-data: 
